function App() {
  return (
    <div className="container">
      <Router>
        <Nav /> {/* Navigation bar */}
        <div>
          <main>
            <Routes>
              {/* Set up routes for navigation between pages */}
              <Route path="/" element={<Home />} /> {/* Home page */}
              <Route path="/about" element={<About />} /> {/* About page */}
              <Route path="/contact" element={<Contact />} />{" "}{/* Contact page */}
              <Route path="/features" element={<Features />} />{" "}{/* Features page */}
              <Route path="/media" element={<Media data={data} />} />{" "}{/* Media page with data passed as props */}
            </Routes>
          </main>
        </div>
        <Footer /> {/* Footer component */}
      </Router>
    </div>
  );
}

// Export App component to index.js for rendering
export default App;
